import React from 'react';
import { Slider } from '@material-ui/core';
import { withStyles, makeStyles } from '@material-ui/core/styles';

class AgeSlider extends React.Component {
	constructor(props) {
		super(props)
	}

	max_change(val) {
		this.props.max_change_handler(val, "max")
	}

	min_change(val) {
		this.props.min_change_handler(val, "min")
	}

	render() {

		function AirbnbThumbComponent(props) {
		return (
					<span {...props}>
						<span className="bar" />
						<span className="bar" />
						<span className="bar" />
					</span>
				);
		}

		const PrettoSlider = withStyles({
			root: {
				color: '#52af77',
				height: 8,
			},
			thumb: {
				height: 24,
				width: 24,
				backgroundColor: '#fff',
				border: '2px solid currentColor',
				marginTop: -8,
				marginLeft: -12,
				'&:focus,&:hover,&$active': {
					boxShadow: 'inherit',
				},
			},
			active: {},
			valueLabel: {
				left: 'calc(-50% + 4px)',
			},
			track: {
				height: 8,
				borderRadius: 4,
			},
			rail: {
				height: 8,
				borderRadius: 4,
			},
		})(Slider);



		return (
			<div>
				<PrettoSlider
					valueLabelDisplay="auto"
					aria-label="pretto slider"
					defaultValue={20}
					onChangeCommitted={(e, data) => this.min_change(data)}
				/>
				<PrettoSlider
					valueLabelDisplay="auto"
					aria-label="pretto slider"
					defaultValue={30}
					onChangeCommitted={(e, data) => this.max_change(data)}
				/>
			</div>
		)
	}
}

export default AgeSlider;
